import React from 'react'

const Videos = ({videos}) => {
  return (
    <div direction='row' flexWrap='wrap' justifyContent='start' gap={2}>
      {videos.map((item, index) => (
        <div key={index}>
          {item.id.videoID && <VideoCard />}
        </div>
      ))};
    </div>
  )
}

export default Videos
